import react, { useEffect, useState } from "react";
const key = "AIzaSyCAtVr05aFuBDr243eW9kK5Hon_FKYgsjM";
const id = "UChJ5FTsHOu72_5OVx0rvsvQ";
const url = `https://www.googleapis.com/youtube/v3/search?part=snippet&channelId=${id}&type=video&eventType=upcoming&key=${key} `;
export const YTvideos = () => {
  const [allvideos, setAllvideos] = useState([]);
  //use api in react
  useEffect(() => {
    fetch(url)
      .then((response) => {
        response.json();
      })
      .then((resJson) => {
        const result = resJson.item.map((doc) => ({
          ...doc,
          VideoLink: "https://www.youtube.com/embed/" + doc.id.videoId,
        }));
        setAllvideos(result);
      });
  }, []);
  console.log(allvideos);
  return (

    <div>
           <h1>tasasd</h1>
      {allvideos.map((item) => {
        return (

          <div>
            <iframe
              width="400"
              height="220"
              class="video"
              src={item.VideoLink}
              title="youtude vidieo"
            ></iframe>

          </div>


        );
      })}
    </div>
  );
};
